};

const RestaurantSlide: React.FC<Props> = ({ rests }) => {
  return (
    <div className="rest-slide-container">
      <div className="rest-slide-title">
        THE POPULAR RESTAURANTS IN EPICURE :
      </div>
      <div className="rest-slide">
        {rests.map((rest, index) => {
          return (
            <PicContainer
              key={index}
              type="rest-carusel"
              pic={rest.pic}
              title={rest.name}
              text={rest.chefName}
              icons={[]}
              price=""
              id={rest._id}
